const weights = {
  name_score: 5,
  address_score: 0,
  opening_hours_score: 2,
  location_proximity_score: 1
};

const threshold = 0.7;

return items.map(item => {
  const data = item.json;

  const name_score = parseFloat(data.name_score) || 0;
  const address_score = parseFloat(data.address_score) || 0;
  const opening_hours_score = parseFloat(data.opening_hours_score) || 0;
  const location_proximity_score = parseFloat(data.location_proximity_score) || 0;

  const totalWeightedScore =
    name_score * weights.name_score +
    address_score * weights.address_score +
    opening_hours_score * weights.opening_hours_score +
    location_proximity_score * weights.location_proximity_score;

  const totalWeight =
    weights.name_score +
    weights.address_score +
    weights.opening_hours_score +
    weights.location_proximity_score;

  const finalScore = totalWeightedScore / totalWeight;

  return {
    json: {
      weighted_score: parseFloat(finalScore.toFixed(3)),
      is_probably_chinese: finalScore >= threshold,
      confidence_level: `${Math.round(finalScore * 100)}%`
    }
  };
});

