function haversine(lat1, lon1, lat2, lon2) {
  const R = 6371; // Earth radius in km
  const dLat = (lat2 - lat1) * Math.PI / 180;
  const dLon = (lon2 - lon1) * Math.PI / 180;
  const a =
    Math.sin(dLat / 2) ** 2 +
    Math.cos(lat1 * Math.PI / 180) *
    Math.cos(lat2 * Math.PI / 180) *
    Math.sin(dLon / 2) ** 2;
  const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
  return R * c;
}

function getLocationScore(lat, lon) {
  if (lat == null || lon == null) return 0;

  return chineseZones.reduce((maxScore, zone) => {
    const distance = haversine(lat, lon, zone.lat, zone.lon);
    const proximityScore = Math.max(0, 1 - distance / 1.0); // Full score within 1 km
    return Math.max(maxScore, proximityScore * zone.weight);
  }, 0);
}

function getPrompt(restaurant) {
  const lat = restaurant.latitude;
  const lon = restaurant.longitude;
  const locationScore = getLocationScore(lat, lon);
  const name = restaurant.name || "Not available";
  const address = restaurant.address || restaurant.vicinity || "Not available";
  const openingHours = restaurant.opening_hours || "Not available";

  return {
    json: {
      prompt: `
