3. Opening Hours: Do the business hours resemble the typical schedule of a Chinese restaurant (e.g., open for lunch and dinner, often closed late)?
4. Location Proximity: Based on GPS coordinates, is this restaurant located near a known Chinese neighborhood in Antananarivo?

Then, based on your judgment, calculate a final score (between 0 and 1) that reflects your overall confidence that this is a Chinese restaurant.

üõë IMPORTANT:
Respond **only** with a valid JSON object in the format below. Do **not** include any explanation, commentary, markdown formatting, or any other text.

Return exactly this JSON format:

{
  "name_score": number (0 to 1),
  "address_score": number (0 to 1),
  "opening_hours_score": number (0 to 1),
  "location_proximity_score": ${locationScore.toFixed(2)},
  "final_score": number (0 to 1),
