function ratingToStars(rating) {
  const fullStars = Math.floor(rating);
  const halfStar = rating - fullStars >= 0.5;
  let stars = '‚òÖ'.repeat(fullStars);
  if (halfStar) stars += '¬Ω';
  stars = stars.padEnd(5, '‚òÜ');
  return stars;
}

function formatOpeningHours(hoursStr) {
  if (!hoursStr || hoursStr === 'N/A') return 'Horaires non disponibles';
  const days = hoursStr.split(';').map(day => day.trim());
  return days
    .map(day =>
      day
        .replace(/[‚Äì‚Äî]/g, ' - ') // tirets longs remplac√©s par tiret simple espac√©
        .replace(/\u202F/g, ' ') // espace ins√©cable fine
        .replace(/\u2009/g, ' ') // espace fine
    )
    .join('<br>');
}

